"<div>\n<i class=\"NoteType\">\n\u041a\u0440\u0430\u0442\u043a\u0430\u044f \u0438\u0441\u0442\u043e\u0440\u0438\u044f\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong>\t\u0412\u044f\u0442\u0441\u043a\u043e\u0435 \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e</strong> \u0441 \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u043e \u0438\u043c\u0435\u043d\u043d\u044b\u043c \u0412\u044b\u0441\u043e\u0447\u0430\u0439\u0448\u0438\u043c \u0423\u043a\u0430\u0437\u043e\u043c \u043e\u0442 <strong>11 (22) \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f 1780 \u0433\u043e\u0434\u0430</strong> \u0438\u0437 \u0412\u044f\u0442\u0441\u043a\u043e\u0439 \u0438 \u0447\u0430\u0441\u0442\u0435\u0439 \u0421\u0432\u0438\u044f\u0436\u0441\u043a\u043e\u0439 \u0438 \u041a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0439 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439 \u041a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438. \u0410\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u044b\u043c \u0446\u0435\u043d\u0442\u0440\u043e\u043c \u043d\u043e\u0432\u043e\u0433\u043e \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0441\u0442\u0430\u043b \u0433\u043e\u0440\u043e\u0434 <a href=\"place.html\">\u0425\u043b\u044b\u043d\u043e\u0432</a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u043e \u044d\u0442\u043e\u043c\u0443 \u043f\u043e\u0432\u043e\u0434\u0443 \u043e\u0441\u043e\u0431\u044b\u043c \u0443\u043a\u0430\u0437\u043e\u043c \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b II \u0431\u044b\u043b \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d \u0432 \u0433\u043e\u0440\u043e\u0434 \u0412\u044f\u0442\u043a\u0443 [<a href=\"https://ru.wikipedia.org/wiki/\u0412\u044f\u0442\u0441\u043a\u043e\u0435_\u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e\">1</a>].<br />\n\t\u0423\u043a\u0430\u0437\u043e\u043c \u043e\u0442 <strong>31 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1796 (11 \u044f\u043d\u0432\u0430\u0440\u044f 1797) \u0433\u043e\u0434\u0430</strong> \u0412\u044f\u0442\u0441\u043a\u043e\u0435 \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0431\u044b\u043b\u043e \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u043e \u0432 <strong>\u0412\u044f\u0442\u0441\u043a\u0443\u044e \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u044e</strong>, \u0430 \u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 - \u0432 \u0433\u0443\u0431\u0435\u0440\u043d\u0441\u043a\u043e\u0435 [<a href=\"https://ru.wikipedia.org/wiki/\u0412\u044f\u0442\u0441\u043a\u043e\u0435_\u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e\">1</a>].<br />\n<strong>\t14 \u044f\u043d\u0432\u0430\u0440\u044f 1929 \u0433\u043e\u0434\u0430</strong> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u043f\u0440\u0435\u0437\u0438\u0434\u0438\u0443\u043c\u0430 \u0412\u0426\u0418\u041a <strong>\u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438</strong> \u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u0438 <strong>\u0412\u044f\u0442\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0439</strong>, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0439 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0441\u043a\u043e\u0439 \u0438 \u041a\u043e\u0441\u0442\u0440\u043e\u043c\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0439 <strong>\u0441\u043e\u0437\u0434\u0430\u0451\u0442\u0441\u044f </strong><a href=\"place.html?pdx=4\"><strong>\u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c</strong></a><strong></strong> [<a href=\"https://ru.wikipedia.org/wiki/\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f_\u043e\u0431\u043b\u0430\u0441\u0442\u044c\">2</a>].<br />\n<strong>\t7 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1934 \u0433\u043e\u0434\u0430</strong> \u043e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0441 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0433\u043e\u0440\u043e\u0434\u0430 \u0412\u044f\u0442\u043a\u0438 \u0432 <a href=\"place.html\">\u041a\u0438\u0440\u043e\u0432</a> \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0430\u044f \u0432\u044b\u0434\u0435\u043b\u044f\u0435\u0442\u0441\u044f <strong>\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439</strong>, \u043a\u0443\u0434\u0430 \u0432\u043e\u0448\u043b\u0438 37 \u0440\u0430\u0439\u043e\u043d\u043e\u0432 \u0413\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0430\u044f, \u0423\u0434\u043c\u0443\u0440\u0442\u0441\u043a\u0430\u044f \u0410\u0421\u0421\u0420, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0412\u043e\u0442\u043a\u0438\u043d\u0441\u043a\u0438\u0439 \u0438 \u0421\u0430\u0440\u0430\u043f\u0443\u043b\u044c\u0441\u043a\u0438\u0439 \u0440\u0430\u0439\u043e\u043d\u044b \u0421\u0432\u0435\u0440\u0434\u043b\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 [<a href=\"https://ru.wikipedia.org/wiki/\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f_\u043e\u0431\u043b\u0430\u0441\u0442\u044c\">2</a>].<br />\n<strong>\t7 \u0434\u0435\u043a\u0430\u0431\u0440\u044f 1936 \u0433\u043e\u0434\u0430</strong> \u0432 \u043f\u0440\u0435\u0434\u0434\u0432\u0435\u0440\u0438\u0438 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0420\u0421\u0424\u0421\u0420 1937 \u0433\u043e\u0434\u0430 \u043b\u0438\u043a\u0432\u0438\u0434\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u043a\u0440\u0430\u0435\u0432\u043e\u0435 \u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u0432 \u0420\u0421\u0424\u0421\u0420, \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u041a\u0438\u0440\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0430\u044f \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0423\u0434\u043c\u0443\u0440\u0442\u0441\u043a\u0430\u044f \u0410\u0421\u0421\u0420, \u0441\u0430\u043c \u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d \u0432 <strong>\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0443\u044e \u043e\u0431\u043b\u0430\u0441\u0442\u044c</strong> [<a href=\"https://ru.wikipedia.org/wiki/\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f_\u043e\u0431\u043b\u0430\u0441\u0442\u044c\">2</a>].\n</p>\n<p>\n\u0421\u0441\u044b\u043b\u043a\u0438:<br />\n1. https://ru.wikipedia.org/wiki/\u0412\u044f\u0442\u0441\u043a\u043e\u0435_\u043d\u0430\u043c\u0435\u0441\u0442\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e<br />\n2. https://ru.wikipedia.org/wiki/\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f_\u043e\u0431\u043b\u0430\u0441\u0442\u044c\n</p>\n</div>\n</div>",
